import React from 'react';

function Collect() {
  fetch('https://gateway.pinata.cloud/ipfs/QmU5bwaw1crBiUcbRmFCwQHkHJX9bM2fA3hC1uaEiVvSdP')
  .then(res => res.json())
  .then((out) => {
    console.log(out);
  })
  .catch(err => {
    throw err
  });


  return (
    <div className="App">

    </div>
  );
}

export default Collect;
